import { useParams } from "react-router-dom";
import useTweet from "../hook/useTweet";

export const TweetPage = () => {
  const { id } = useParams();

  const { tweet, loading, error } = useTweet(id);

  return (
    <section>
      <h1>Tweet</h1>
      <p>Tweets</p>
    </section>
  );
};

export default TweetPage;
